import "../index.css";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="nav-bar">
      <ul className="nav-ul">
        <li>
          <Link to="/" className="nav-ink">
            Home
          </Link>
        </li>
        <li>
          <Link to="/about" className="nav-ink">
            About
          </Link>
        </li>
        <li>
          <Link to="/contact" className="nav-ink">
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
